

function fib(n) {
    var j = BigInt(0), k = BigInt(1), i = Math.abs(n), x = 0;
    if(n > 1000000){
        i -= 1000000;
        k = BigInt();
        j = BigInt();
    }
    while (i > 0){
        i--,x = k, k += j, j = x;
    }
    return n < 0 ? BigInt(Math.pow(-1, Math.abs(n)-1)) * j : BigInt(j);
    }

  console.log(fib(1890483));